colors = ["blue", "red", "black", "green", "pink", "orange", "lightblue", "black", "brown", "purple", "grey", "#00fffb", "#6000e2", "red", "blue"]

def parallel_plot(system_id_idx: int) -> None:
    res = []
    for x in results:
        res.append(x[system_id_idx+1])

    prefix = "0" if system_id_idx+1 < 10 else ""
    system_id = "A" + prefix + str(system_id_idx+1)

    figure(figsize=(16, 8))
    plt.title(system_id)

    for model_idx in range(len(models)):
        _from = 6 * model_idx
        _to = 6 * (model_idx+1)
        curr_res = res[_from:_to]

        plt.plot([idx + _from for idx in range(len(curr_res))], curr_res, '*', color=colors[model_idx])

    plt.legend(labels=models)
    plt.savefig("system_ids_accuracies/" + system_id + ".png")
    plt.close()

ncpu = int(pa.helpers.cpu_count() / 2)
with pa.multiprocessing.ProcessingPool(ncpu) as p:
    all_res = list(tqdm(p.imap(parallel_plot, range(19)), total=19))


